import React from "react";
import EmpolyerItem from "./EmpolyerItem.js";


const Empolyer = () => {




    return(
        <div className="empolyer">
            <div className="row">
            <EmpolyerItem
                className='col-md-4'
                p = {{
                        name:'NOUR',
                        nick:'HOMSI', 
                        role:'web developer',
                        img:'https://picsum.photos/id/60/200/300', 
                        alt:'pic-empolyee-1',
                    }}
                />

            <EmpolyerItem 
                className='col-md-4'
                p = {{
                        name:'NADHIR',
                        nick:'NACEF',
                        role:'designer', 
                        img:'https://picsum.photos/id/61/200/300', 
                        alt:'pic-empolyee-2',
                    }}
                />

            <EmpolyerItem 
                className='col-md-4'
                p = {
                    {
                        name:'RAOUF', 
                        nick:'ALIM', 
                        role:'mobile developer', 
                        img:'https://picsum.photos/id/62/200/300', 
                        alt:'pic-empolyee-3',
                    }
                }
                />
            </div>
            <EmpolyerItem 
                className='col-md-4'
                p = {
                    {
                        name:'MEHDI',
                        nick:'SLIMANI', 
                        role:'desktop developer', 
                        img:'https://picsum.photos/id/63/200/300', 
                        alt:'pic-empolyee-4',
                    }
                }
                />
            
            <EmpolyerItem 
                className='col-md-4'
                p = {
                    {
                        name:'ABDEALI',
                        nick:'GHERDIS', 
                        role:'Web Developer', 
                        img:'https://picsum.photos/id/64/200/300', 
                        alt:'pic-empolyee-5',
                    }
                }
                />

        </div>
    )
}
export default Empolyer
